import React from "react";

const CreateNote = (props) => {
  const clicked = () => {
    props.clicked();
  };
  return (
    <>
      <div>
        <br />
        <input type="text" placeholder="Title" value={props.title} />
        <br />
        <textarea
          placeholder="Write a note..."
          rows="4"
          cols="21"
          value={props.content}
        />
        <button onClick={clicked}>+</button>
      </div>
    </>
  );
};

export default CreateNote;
